import React from 'react';
import { Navigate as BigNav, Navigate, createBrowserRouter } from "react-router-dom";
// import Layout from "./Layout/Layout";
// import Home from "./component/General/home";
// import Login from "./component/General/Login";
// import SignIn from './component/General/SignIn';
// import MyProfile from "./component/User/myProfile";

import Layout from "../layouts/Layout";
// import React from 'react';
import HomePage from "../pages/HomePage";
export const router = createBrowserRouter([
    {
        path: '/',
        element: React.Component,
        children: [
            {
                path: '/',
                element: HomePage()
            },
            // {
            //     path: '/home',
            //     element: <h1>About</h1>
            // },
            {
                path: 'user/',
                // element: <h1>Products</h1>
                children:[
                    
                    {
                        path:'myTracks/',
                        children:[
                            {
                                path:'/'
                            },
                            {
                                path:'updateTrack/:id'
                            },
                            {
                                path:'addTrack'
                            }
                        ]
                    },
                    {
                        path:'favourites'
                    },
                    {
                        path:'myProfile',
                        // element:<MyProfile />,
                        // loader:() => {
                        //     console.log("hello")
                        //     return "hello";
        
                        // }
                    },
                    {
                        path:'updateProfile'
                    }
                    
                ]
            },
            {
                path: '/SignIn',
                // element: <SignIn/>
            },
            {
                path: '/Login',
                // element: <Login/>
            },
            {
                path: '/findTrack',
                // element:
            },
            {
                path:'/viewTrack'
            }
            

        ]
    },
   
    {
        path: '*',
        element: Navigate({to:'/'}),
    },

]);
